import React from "react";
import { Router, Route, Switch } from "react-router";

//pages and components
import Home from "./Pages/Home";

const App = () => {
  return (
    <Router>
      <Switch>
        <div>
          <Route path="/home" component={Home}/>
        </div>
      </Switch>
    </Router>
  );
};
export default App;
